import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link} from 'react-router-dom';
import { Button, ButtonGroup, ButtonToolbar} from 'reactstrap';
import { Card, CardImg, CardText, CardBody, CardTitle, CardDeck, CardGroup } from 'reactstrap';
import './css/Metrics.css';
import './index.js';

import { DashBoard } from './DashBoard';

export class Metrics extends Component {
    render() {



        return(

            // Eventually need to pass in metric values as props from app.js...
            <div>
                <MetricAreaCard metricName="CDS" metricID="CDS"/>
                <MetricAreaCard metricName="Clinical Training"/>
                <MetricAreaCard metricName="EB Training"/>
                <MetricAreaCard metricName="Eye Bank Partners"/>
                <MetricAreaCard metricName="Finance"/>
                <MetricAreaCard metricName="Global Donor Operations"/>
                <MetricAreaCard metricName="Human Resources"/>
                <MetricAreaCard metricName="MA"/>
                <MetricAreaCard metricName="Policy & Advocacy"/>
                <MetricAreaCard metricName="Prevention"/>
                <MetricAreaCard metricName="Quality"/>
                <MetricAreaCard metricName="Training"/>
                <MetricAreaCard metricName="Interventions"/>
            </div>
        )
    }
}

// Represents a single metric button to render. A single metric card will contain the name of the metric
// and acts as a link to the dashboard of the respective metric. 
class MetricAreaCard extends Component {
    render() {
        return (
            <div>
                <Route path={'/Metrics/' + this.props.metricID}>{this.props.metricName}</Route>
            </div>
        )
    }
}
